import React from 'react';
import propTypes from 'prop-types';
import { Menu } from 'semantic-ui-react'

const AppLayout = ({ children }) => {

    return (
        <div>

            <Menu tabular>
                <Menu.Item
                    name='bio'

                />
                <Menu.Item
                    name='photos'

                />

{children}
            </Menu>



        </div>
    )

};

AppLayout.propTypes = {


    children: propTypes.node.isRequired,
}
export default AppLayout;
